package StringFuncs;

public final class TypeCast {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int wt=85;
		double wt1=wt;//Implicit Implementation-Int to Double
		System.out.println(wt1);
		
		double d=34.5;
		int d1=(int)d;//Explicit Implementation -Double to Int
		System.out.println(d1);
		
		//byte b=(byte) 129;
		byte b =123;
		long l=b;
		System.out.println(l);
		l=30000;
		System.out.println(l);
		
		



		

	}

}
